def gcd(x, y):
    if x % y != 0:
        return y
    else:
        return gcd(y, x % y)

def bezout(x, y):
    if x % y == 0:
        return (0, 1)
    else:
        (t, s) = bezout(y, x % y)
        return (s, t - x // y * s)

def find_integer_point_on_line(A, B, C):
    if A == 0:
        if C % B == 0:
            return (0, -C // B)
        else:
            return -1
    if B == 0:
        if C % A == 0:
            return (-C // A, 0)
        else:
            return -1
    if C % gcd(A, B) != 0:
        return -1
    else:
        (x, y) = bezout(A, B)
        m = -C // gcd(A, B)
        return (m * x, m * y)

